import '../Images/project_1_image.png'

export default function WorkHistoryContainer(props) {
    let counter = 1
    return(<ul className="workHistory">
        {props.projects.map(project => {
            let classID = counter%2===0 ? "project even" : "project odd"
            counter++;
            return (
                <li>
                    <div className="title">{project.title}</div>
                    <div className={classID}>
                        <span className="description"> Description </span>
                        <img className="picture" src={project.image} alt={project.title + " image"}/>
                    </div>
                </li>
            );
        })}
    </ul>);
}
